import React, { Component } from "react";
import styled from "styled-components";
import botaoAcoes from "./botaoAcoes";
import { getDataFromUrl } from "./functionsLibrary";

function getButtonNames() {
  const data = JSON.parse(getDataFromUrl()).data.summary;
  let dictfinal = [];

  for (let d in data) {
    let info = {};
    switch (d) {
      case "grossBalance":
        info.nome = "SALDO BRUTO";
        info.valor = data[d];
        dictfinal.push(info);
        break;
      case "appliedValue":
        info.nome = "VALOR APLICADO";
        info.valor = data[d];
        dictfinal.push(info);
        break;
      case "capitalGains":
        info.nome = "GANHO DE CAPITAL";
        info.valor = data[d];
        dictfinal.push(info);
        break;
      case "earnings":
        info.nome = "TOTAL DISTRIBUÍDOS";
        info.valor = data[d];
        dictfinal.push(info);
        break;
      case "yield":
        info.nome = "YIELD";
        info.valor = data[d];
        dictfinal.push(info);
        break;
    }
  }
  return dictfinal;
}

console.log(getButtonNames());
class BotaoAcoes extends Component {
  state = { dados: getButtonNames() };

  render() {
    return this.state.dados.map(dado => (
      <botaoAcoes nomeButton={dado.nome} valor={dado.valor} />
    ));
  }
}

export default BotaoAcoes;
